import './App.css';

function App() {
  return (
    <div className="App">
      <div className='AddingPassword'>
        <input type="text" placeholder='password123'/>
        <input type="text" placeholder='Facebook'/>
        <button>Add Password</button>
      </div>
    </div>
  );
}

export default App;
